import React from "react";
import ErrorPageWrapper from "../../assets/wrappers/ErrorPage/ErrorPageWrapper";
import { Container, Row, Col } from "react-bootstrap";
import PageSectionWrapper from "../../assets/wrappers/PageSectionWrapper";
import banner from "../../assets/images/img11.jpeg";
const ErrorPage = () => {
  return (
    <PageSectionWrapper>
      <ErrorPageWrapper>
        <Container>
          <Row>
            <Col lg={12}>
              <h1>This is the error page</h1>
            </Col>
          </Row>
        </Container>
      </ErrorPageWrapper>
    </PageSectionWrapper>
  );
};

export default ErrorPage;
